(21, '#Food1809140651424', '9Lives Daily Essentials Cat Food ', '', '<p>\r\n\r\n</p><p><strong>9Lives Daily Essentials Cat Food 5.5kg</strong></p><ul><li>100% complete and balanced nutrition for all cat life stages</li><li>Omega 3 fatty acids help promote healthy skin and coat</li><li>High quality protein helps support strong muscle growth</li><li>Taurine helps maintain heart and vision health</li></ul><p>Give your cat the nutrition he needs every day in every life stage. 9 Lives Daily Essentials Cat Food delivers nutrition that helps support heart health clear vision strong muscles and healthy skin and coat.</p><h5>Ingredients:</h5><p>Whole Ground Corn, Chicken By-product Meal, Corn Gluten Meal, Soybean Meal, Whole Wheat, Beef Fat (Preserved with Mixed Tocopherols), Meat and Bone Meal, Animal Digest, Salmon Meal, Salt, Phosphoric Acid, Choline Chloride, Titanium Dioxide (Color), Vitamins (Vitamin E Supplement, Niacin Supplement, Vitamin A Supplement, D-Calcium Pantothenate, Thiamine Mononitrate, Riboflavin Supplement, Pyridoxine Hydrochloride, Menadione Sodium Bisulfite Complex, Vitamin D3 Supplement, Folic Acid, Biotin, Vitamin B12 Supplement), Potassium Chloride, Taurine, Minerals (Ferrous Sulfate, Zinc Oxide, Manganous Oxide, Copper Sulfate, Calcium Iodate, Sodium Selenite), Red 40, Yellow 5, Yellow 6, BHA (Used as a Preservative), Blue 1, Blue 2, Rosemary Extract.</p><h5>Guaranteed Analysis:</h5><ul><li><p>Crude Protein (min.)  30.00%</p></li><li><p>Crude Fat (min.)  9.00%</p></li><li><p>Crude Fiber (max.)  3.00%</p></li><li><p>Moisture (max.)  12.00%</p></li><li><p>Calcium (min.)  1.00%</p></li><li><p>Phosphorus (min.)  0.80%</p></li><li><p>Iron (min.)  180 mg/kg</p></li><li><p>Selenium (min.)  0.475 mg/kg</p></li><li><p>Vitamin E (min.)  100 IU/kg</p></li><li><p>Taurine (min.)  0.10%</p></li><li><p>Omega-3 Fatty Acids (min.)  0.12%</p></li></ul><h5>Feeding Guide:</h5><p>A single morning serving will allow your cat to nibble freely throughout the day. The serving size should be adjusted based on your cat\'s age and activity level.</p><p>Water is essential to your cat\'s good health. Always provide your cat with a bowl of fresh water.</p>\r\n\r\n<br><p></p>', '9Lives.png', '1250.00', 'Pet Shop PH', '2019-06-30', '1400.00', '5 (Kg) ', '5', 'Kg');
