INSERT INTO `tbl_productitems` (`item_table_id`, `item_id`, `itemname`, `itemdescription`, `itemImage`, `price`, `supplier`, `store_price`) VALUES
(24, '#Item1809060450060', 'Bone Toy for Dogs', '<p>Bone Toy for Dogs<br></p>', 'bone_2.jpg', '88.00', 'Royal Canin', '98.56'),
(25, '#Item1809140645518', 'Petego Diva Dog ', '<p>\r\n\r\n</p><p>The Diva Dog haute couture food and water bowls designed by Emanuele Bianchi are on the cutting edge of fashion and sophistication. The bold colors, sleek graphics and sassy design let your dog enjoy mealtime in high style. These sturdy bowls feature anti-skid feet and comfortable cutout handle. Hand wash bowls. Not for use in the microwave.</p><h2>Product Specifications</h2><p>Manufactured By</p><p>PetEgo EB Design &nbsp;</p><p>Sold By</p><p>Houzz &nbsp;</p><p>Size/Weight</p><p>W 7.5\" / D 7.5\" / H 2.1\" / 5.6 oz. </p>\r\n\r\n<br><p></p>', 'Dog_Bowl1.png', '250.00', 'Pet Shop PH', '280.00'),
(26, '#Item1809140648570', ' Metal Comb Plastic Handle', '<p>\r\n\r\n</p><p><strong>2-sided Metal Comb Plastic Handle- Blue</strong></p><p>REMOVES tangled, matted hair. Eliminates stressful tugging episodes. Your pet will enjoy having loose hair and dirt removed from his / her coat</p><p>REDUCES shedding with regular use. Share your home with your pet, without surrendering your clothing and furniture to pet hair</p><p>MASSAGING stainless steel teeth relax your pet while stimulating the skin to produce natural oils, restoring beautiful healthy sheen to your pets coat.</p>\r\n\r\n<br><p></p>', 'MetalComb.jpg', '120.00', 'Pet Shop PH', '134.40'),
(28, '#Item1809140701339', '2 Pair Lightweight Pet Foot Shoes For Toy Dog', '<p>\r\n\r\n</p><p><strong>2 Pair Lightweight Pet Foot Shoes for Toy Dog (Red)</strong></p><p>New Comfortable Anti-slip Puppy Dog Shoes</p><ul><li>Comfortable Anti-slip Puppy Dog Shoes</li><li>The Pet Shoes is fashion accessory for your special pet.</li></ul>\r\n\r\n<br><p></p>', 'PetShoes.jpg', '350.00', 'Pet Shop PH', '392.00');
INSERT INTO `tbl_productmedicines` (`med_table_id`, `med_id`, `medType`, `medname`, `meddescription`, `medImage`, `dateAdded`, `price`, `supplier`, `exp_date`, `store_price`, `product_unit`, `product_unit_number`, `product_unit_measure`) VALUES
(15, '#Med1809060427477', 'Antibiotics', 'Filine Edopathic ', '<p>\r\n\r\n<b>Feline idiopathic cystitis</b>&nbsp;(FIC) <b>Feline</b>&nbsp;lower urinary tract disease (FLUTD) is a term describing conditions that can affect the urinary bladder and/or urethra (the lower urinary tract) of <b>cats</b>.\r\n\r\n<br></p>', 'AdSlots468_HI_Q3_2018112.jpg', '0000-00-00 00:00:00', '55.00', 'Royal Canin', '2018-10-06', '61.60', '1 (MilliLiters) ', '1', 'MilliLiters'),
(16, '#Med1809060430540', 'Vaccine', 'Dentasticks', '<p>\r\n\r\nLittle guys love the tasty <b>DENTASTIX</b>&nbsp;flavor, and these treats have a softer texture for young mouths to start off your <b>Puppy\'s</b>&nbsp;oral health routine in a delicious way. ...<b>Feed puppy</b>&nbsp;dogs (5 + lbs/2.27 + kg) 1 treat a day. Not suitable for <b>puppies</b>&nbsp;and dogs under 6 months of age and 5 lbs (2.27 kg).\r\n\r\n<br></p>', 'b76ead09f9fa333e22c4c3282a9c6103_jpg_2200x2200q80.jpg', '0000-00-00 00:00:00', '88.00', 'Royal Canin', '2018-09-29', '98.56', '3 (Kg) ', '3', 'Kg'),
(17, '#Med1809141208272', 'Antibiotics', 'Clavamox', '<p>\r\n\r\n<b>Indication</b>?Treatment of dogs: skin &amp; soft tissue infections i.e. wounds, abscesses, cellulitis, superficial/juvenile &amp; deep pyoderma due to susceptible strains of the following organisms: beta-lactamase producing llll Staphylococcus aureus jjjj, non-beta-lactamase producing llll Staphylococcus aureus, Streptococcus jjjj spp. &amp; llll Escherichia coli jjjj. Periodontal infections due to susceptible strains of both aerobic &amp; anaerobic bacteria.</p><p><b>Dosage</b>?Dogs: 13.75 mg/kg (6.25 mg/lb) BW twice a day. Skin &amp; soft tissue infections i.e. abscesses, cellulitis, wounds, superficial/juvenile pyoderma &amp; periodontal infections should be treated 5-7 days or 48 hrs after all symptoms have subsided. Deep pyoderma may require treatment for 21 days. Max duration of treatment should not exceed 30 days.</p><p><b>Contraindications</b>?Animals w/ history of an allergic reaction to any of the penicillins or cephalosporins.</p><p><b>Precautions</b>?For use in dogs only.</p><p><b>Side effects</b>?Allergic reactions.\r\n\r\n<br></p>', 'Clavamox_250.jpg', '0000-00-00 00:00:00', '110.00', 'Zoetis Philippines, Inc.', '2019-06-30', '123.20', '250 (MilliGrams) ', '250', 'MilliGrams'),
(18, '#Med1809140513312', 'Antibiotics', 'Duplocillin', '<p>\r\n\r\n<b>Indication</b>?Treatment of local &amp; systemic infections caused by bacteria sensitive to penicillin in horses, cattle, pigs, sheep, dogs &amp; cats, where a prolongation of therapeutic period from a single inj is required.</p><p><b>Dosage</b>?By IM inj (large animals), SC inj (dogs &amp; cats). Horses/cattle: 1 mL/25 kg. Pigs/sheep: 1 mL/20 kg. Dogs/cats: 1 mL/10 kg. Inj may be repeated at 72-hr intervals depending on clinical judgment given at a different inj site.</p><p><b>Contraindications</b>?Hypersensitive to penicillin. Not to be used when it is known that beta-lactamase-producing bacteria are involved.</p><p><b>Side effects</b>?Transient pyrexia, vomiting, shivering &amp; incoordination in pigs. Abortion has been reported in few cases.\r\n\r\n<br></p>', 'duplocillin.jpg', '0000-00-00 00:00:00', '960.00', 'MSD Animal Health (Phils.), Inc.', '2019-09-14', '1075.20', '100 (MilliLiters) ', '100', 'MilliLiters'),
(19, '#Med1809140541418', 'Antibiotics', 'Laktrazine', '<p>\r\n\r\n<b>Indicatio</b>n?Treatment of urinary tract, respiratory, skin &amp; GI infections in dogs &amp; cats. Controls pneumonia, otitis media, prostatitis, kennel cough, coccidiosis &amp; staphylococcal infections.</p><p><b>Dosage</b>?Dogs: 15 mg/kg BW or  tab, twice daily for 7 days. Cats: 120 mg or  tab, daily for 7 days.</p><p><b>Precautions</b>?Do not give to pregnant animals, animals w/ known hypersensitivity, w/ liver impairment &amp; blood disorders.\r\n\r\n<br></p>', 'Laktrazine.jpg', '0000-00-00 00:00:00', '220.00', 'Fanfreluche Enterprises, Inc.', '2020-02-25', '246.40', '400 (MilliGrams) ', '400', 'MilliGrams');
