(12, 'dog', 'adult (1 year old and above)', 'Grooming for Dogs (Full Service)', '<p>\r\n\r\nAll Full Service Grooming includes: A bath with choice of Green Dog Wash&nbsp;</p><p>ShamPooch, towel and force-air dryer with no heating element, eye and ear&nbsp;</p><p>cleaning/plucking, brush teeth, nail clipping/grinding, brush out, and&nbsp;</p><p>specific haircut&nbsp;</p><p>based upon your dogs breed standard and/or your individual style choice.&nbsp;</p><p>Full Service Grooming is ALWAYS completed by a trained, certified,</p><p>4 and experienced Canine Stylist.\r\n\r\n</p>', '500.00', 'Active'),
