INSERT INTO `tbl_veterinarians` (`veterinarian_table_id`, `veterinarian_id`, `firstname`, `middlename`, `lastname`, `birthdate`, `homeAddress`, `barangayAddress`, `cityAddress`, `postalID`, `dateAdded`, `username`, `password`, `veterinarian_status`, `vetbio`, `profile`, `gender`, `contact`, `email`) VALUES
(8, 'V1808211104490', 'Carlos', 'Almonds', 'Valdez', '1985-02-12', '#3333', 'dsassd', 'sdasd', '1111', '2018-08-21 23:06:10', 'CValdez', 'carlos', 'Active', '<p>\r\n\r\nCarlos Valdez graduated from the University of the Philippines in 1986, and has been a licensed practicing veterinarian since then. He has engaged in numerous pursuits and enterprises, the varying nature of which reflecting his belief that a life in pursuit of knowledge and learning is a life well spent. In addition to animal health and animal welfare, he is concerned with the study of animal behaviour, and the use of intelligent and humane methods to ensure that animals live in harmony with their human companions and vice-versa.\r\n\r\n</p>', 'doctor-winthrop1.jpg', 'Male', '09021232212', 'carlosvaldex10@gmail.com'),
(11, 'V1809130504563', 'Dario', 'B.', 'Dapatnapo', '1975-06-19', '193-A 29th Avenue, East Rembo', '193-A 29th Avenue, East Rembo', 'Makati City', '1216', '2018-09-13 17:15:14', 'DDapatnapo', 'dapatpo', 'Active', '<p>\r\n\r\n\r\n\r\nDr. Dario B. Dapatnapo specializes in the area of Dog and Cat. Our veterinarian is particularly interested in the Clinical/Surgical procedures.<br><br>Our veterinarian practices mainly at the Animal Ark Pet Care Center in Makati City, Metro Manila.<br><br>If you wish to ask for an appointment or seek the doctors help, please send a message by creating your personal account.\r\n\r\n\r\n<br></p>', 'dr-james-ross-tagnia-1484227156-58778254724a3.JPG', 'Male', '2398969', 'dariodapatnapo@gmail.com'),
(12, 'V1809130516268', 'Arwinie', 'A.', 'Serrano', '1967-10-11', '5450 Mayor St., Pio Del Pilar Makati City', '5450 Mayor St., Pio Del Pilar', 'Makati City', '1230', '2018-09-13 17:23:56', 'ASerrano', 'V1809130516268', 'Active', '<p>\r\n\r\n</p><div>Dr. Arwinie A. Serrano specializes in the area of Dog and Cat.<br><br>Our veterinarian practices mainly at the Animal Specialist Care Center in Makati City, Metro Manila.<br><br>If you wish to ask for an appointment or seek the doctors help, please send a message by creating your personal account.</div><br>\r\n\r\n<br><p></p>', 'CIMG7922.jpg', 'Male', '3994730', 'arwinieserrano@gmail.com'),
(13, 'V1809130525260', 'Carlo', 'C.', 'Baltazar', '1970-08-20', '953 J.P Rizal Makati City, Metro Manila', '953 J.P Rizal', 'Makati City', '1210', '2018-09-13 17:29:20', 'CBaltazar', 'V1809130525260', 'Inactive', '<p>\r\n\r\nDr. Carlo C. Baltazar specializes in the area of Dog and Cat. Our veterinarian is particularly interested in the Clinical/Surgical procedures.<br><br>Our veterinarian practices mainly at the CB Veterinary Clinic in Makati City, Metro Manila.<br><br>If you wish to ask for an appointment or seek the doctors help, please send a message by creating a personal account.\r\n\r\n<br></p>', '0000df9d_big.jpg', 'Male', '8834562', 'carlobaltazar@gmail.com');
